Delegate
Introduction
Welcome to Lesson 6 of Part 2: The iOS Ecosystem. We already talked about delegate previously in Part 1. Yet, we haven't applied to view controllers. So let's get started. For now, we are going to use Storyboard because I'm just showing a quick feature. Please bear with me for a bit.
Lecture Notes
Define Protocol
protocol NotifyDelegate: class {
  func sendData(data: String)
}

Delegate VC
import UIKit

class FirstVC: UIViewController, NotifyDelegate {

  @IBOutlet weak var firstLabel: UILabel!

  let secondVC = UIStoryboard(name: "Main", bundle: nil).instantiateViewController(withIdentifier: "SecondVC") as! SecondVC

  override func viewDidLoad() {
    super.viewDidLoad()
    secondVC.delegate = self  
  }

  @IBAction func buttonPressed(_ sender: UIButton) {
    present(secondVC, animated: true, completion: nil)
  }

  func sendData(data: String) {
    print(data)
    firstLabel.text = data
  }

}

Delegator VC
class SecondVC: UIViewController {

   weak var delegate: NotifyDelegate?

  override func viewDidLoad() {
    super.viewDidLoad()
  }

  @IBAction func buttonPressed(_ sender: UIButton) {
    self.dismiss(animated: true, completion: nil)
    delegate?.sendData(data: "Bob the Developer")
  }

}

